import React, { Component } from 'react';
import './ManageIPO.css';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import Button from 'react-bootstrap/Button';
import { DropdownButton,Dropdown} from 'react-bootstrap';

class NavWithDropDown extends Component {
    constructor(props){
        super(props);
    }
    render(){
   
        return(
            <Container>
                <Navbar fixed="top" id="top-navbar" bg="dark" variant="dark">
                        <Navbar.Brand href="/adminHome">StockChart</Navbar.Brand>
                        <Nav className="mr-auto">
                        <Nav.Link href="/importData">Import Data</Nav.Link>
                        <Nav.Link href="/manageCompany">Manage Company</Nav.Link>
                        <Nav.Link href="/manageExchange">Manage Exchange</Nav.Link>
                        <Nav.Link href="/manageIPO">Manage IPO</Nav.Link>
                        </Nav>

                        <Form inline id="search-box-full">
                            <FormControl id="search-box" type="text" placeholder="Search For Company" className="mr-sm-2" />                                                    
                            <Button variant="outline-info">Search</Button>
                        </Form>
                        
                        <DropdownButton menuAlign="right" title="Admin" id="dropdown-menu-align-right">
                            <Dropdown.Item eventKey="1" href="/update">Update Profile</Dropdown.Item>
                            <Dropdown.Divider />
                            <Dropdown.Item eventKey="4" href="/">Logout</Dropdown.Item>
                        </DropdownButton>

                    </Navbar>
                   
                    <br />
                    
            </Container>
        );
    }
}
class ManageIPO extends Component{
    constructor(props){
        super(props);
    }

    render(){
        return(
            <React.Fragment>
                <NavWithDropDown />
            </React.Fragment>
        );
    }
}

export default ManageIPO;
